import React, { Component } from "react";
import "./App.css";

function App() {
  const headingStyle = {
    color: "white",
    fontWeight: "bold",
    alignText: "center",
    fontSize: "80px",
    opacity: 1,
  }

  return (
    <div className="App">
      <div class="image"><h1 style={headingStyle}>Urban Food</h1></div>

    </div>
  );
}


export default App;
